import React from 'react';
import './App.css';
import Landing from './Components/Landing';
import About from './Components/About';
import Products from  './Components/Products';

function App() {
  return (
    <div id="App">
      <Landing />
      <About />
      <Products />
      <Form />
    </div>
  );
}

export default App;
